import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Routes,
    Route,
    useRoutes,
     Link } from "react-router-dom";
import IntroPage from './components/IntroPage/IntroPage'
import QuestionsPage from "./components/QuestionsPage/QuestionsPage";
import DatePage from "./components/DatePage/DatePage";
import CompletionPage from "./components/CompletionPage/CompletionPage";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const routes = {
  "/": () => <IntroPage /> ,
  "/questions": () =>  <QuestionsPage /> ,
  "/date": () => <DatePage /> ,
  "/completion": () => <CompletionPage /> 
}

function App() {
  return (
    <Container>
      <Router>
        <Navbar bg="light" expand={false}>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="text-center">
                <Nav.Link href="/">Start</Nav.Link>
                <Nav.Link href="/questions">Answer Questions</Nav.Link>
                <Nav.Link href="/date">Set Date</Nav.Link>
                <Nav.Link href="/completion">Review Form</Nav.Link>
              </Nav>
            </Navbar.Collapse>
        </Navbar>
        <div>
          <Row>
            <Col xs={6} md={4}>
            </Col>
            <Col xs={6} md={4}>
              <Routes>
                <Route exact path='/' element={<IntroPage/>} />
                <Route path='/questions' element={<QuestionsPage/>} />
                <Route path='/date' element={<DatePage/>} />
                <Route path='/completion' element={<CompletionPage/>} />
              </Routes>
            </Col>
            <Col xs={6} md={4}>
            </Col>
          </Row>
        </div>
      </Router>
    </Container>
    );
  }

export default App;
